def test_context_resilient():
    """Test context is resilient."""
    @click.command()
    @click.option("--value", type=int, default=0)
    def cli(value):
        click.echo(f"value={value}")

    runner = CliRunner()
    result = runner.invoke(cli, ["--value", "5"])
    assert result.exit_code == 0
